const initialState = {
    userId: ''
}

export function userReducer(state = initialState, action) {
    var newState = state
    switch (action.type) {
        case SET_USERID:
            newState = { ...state, SET_USERID: userId }
            break
        case SET_PROPERTIES:
            newState = { ...state, properties: action.properties }
            break
        default:
    }
    // For debug:
    // window.userState = newState
    // console.log('State:', newState)
    return newState

}
